import { MdFavoriteBorder } from "react-icons/md";
import { MdFavorite } from "react-icons/md";
import react, { useState } from "react";

const Like = () => {
  const [isLiked, setIsLiked] = useState(false);
  const handleLike = () => {
    if (isLiked) {
      setIsLiked(true);
    } else {
      setIsLiked(false);
    }
  };
  return isLiked ? (
    <div>
      <MdFavorite />
    </div>
  ) : (
    <div>
      <MdFavoriteBorder />
    </div>
  );
};

export default Like;
